description:
Premonition (2007) 

Verenigde Staten
Drama / Thriller
92 minuten


geregisseerd door Mennan Yapo
met Sandra Bullock, Julian McMahon en Nia Long


Linda Hanson krijgt het schokkende nieuws te horen 
dat haar echtgenoot is overleden als gevolg van een 
auto-ongeluk. Al even schokkend is het feit dat ze 
hem de volgende dag gewoon levend aantreft. Bepaalde 
aanwijzingen doen Linda vrezen dat ze een voorspellende 
gave heeft en ze tracht te voorkomen dat het betreffende 
ongeluk ooit plaats zal vinden.


